import { makeObservable, observable, action, computed } from "mobx"

export class Node {
    col = 0;
    type = 0;
    row = 0;

    constructor(type = 0) {
        makeObservable(this, {
            col: observable,
            type: observable,
            row: observable,
            getType: computed,
            changeType: action
        })
        this.changeType(type);
    }

    get getType() {
        return this.type;
    }

    changeType(type) {
        this.type = type;
    }
}

